import "./UserProfile.css";
import { Col, Row, Container } from "react-bootstrap";

const UserProfile = () => {
  return (
    <Container>
      <Row  style={{height:'200px'}}>
        <Col style={{border:'1px solid black'}}  sm>sm=true</Col>
        <Col sm>sm=true</Col>
        <Col sm>sm=true</Col>
      </Row>
      <Row  style={{height:'200px'}}>
        <Col style={{border:'1px solid black'}} sm={8}>sm=8</Col>
        <Col style={{border:'1px solid black'}}  sm={4}>sm=4</Col>
      </Row>
    </Container>
  );
};

export default UserProfile;
